const Powerstats = ({stats}) => {
  console.log(stats)
  return (
    <div>
      {Object.keys(stats).map((key, index) => (
        <h1 key={Math.random()}>{stats[index]}{stats[key]}</h1>
        ))}
    </div>
  )
}

export default Powerstats
